package main

import (
	"bytes"
	"encoding/base64"
	"errors"
	"fmt"
	"hasparse/unmarshal"
	"log"
)

func main(){
	msgString := ""
	krbMessage, err := base64.StdEncoding.DecodeString(msgString)
	fmt.Println(krbMessage)
	if err != nil {
		log.Fatal(errors.New("request TGT failed, response->krbMessage decode fail by base64"))
	}
	buf := bytes.NewBuffer(krbMessage)
	s1 := unmarshal.Asn1ParserBuffer(*buf)
	fmt.Println(s1)
}
